import { TYPE_OF_ASSET_OPTIONS, ASSET_FOR_OPTIONS, WHO_CAN_CONTACT_OPTIONS, ASSET_STATUS_NOW_OPTIONS, SHOW_MY_ASSET_FOR_TENANTS_OPTIONS, LIKE_OR_DISLIKE_OPTIONS, IS_PROPOSAL_CANCELLED_OPTIONS,  ASSET_HEIGHT_WIDTH_OPTIONS } from '../actions/constants';

const initialState = {
  value: 0,
  is_site_loaded: false
};

const type_of_asset_options = [
  { value: 'House', label: 'House' },
  { value: 'Appartment', label: 'Appartment' },
  { value: 'Store', label: 'Store' },
  { value: 'Koddon', label: 'Koddon' },
  { value: 'Land', label: 'Land' }
];


const asset_for_options = [
  { value: 'Rent', label: 'Rent' },
  { value: 'Lease', label: 'Lease' },
  { value: 'Sale', label: 'Sale' }
];

const who_can_contact_options = [
  { value: 'Bachelor', label: 'Bachelor' },
  { value: 'Single Person', label: 'Single Person' },
  { value: 'Family', label: 'Family' },
  { value: 'Anyone', label: 'Anyone' }
];

const asset_status_now_options = [
  { value: 'Free(available)', label: 'Free(available)' },
  { value: 'Booked(unavailable)', label: 'Booked(unavailable)' },
  { value: 'Tenant on notice period', label: 'Tenant on notice period' },
  { value: 'Asset under maintenance', label: 'Asset under maintenance' }
];

const show_my_asset_for_tenants_options = [
  { value: 'Show', label: 'Show' },
  { value: 'Hide', label: 'Hide' }
];

const like_or_dislike_options = [
  { value: 'Like', label: 'Like' },
  { value: 'Dislike', label: 'Dislike' }
];

const is_proposal_cancelled_options = [
  { value: 'Not Cancelled', label: 'Not Cancelled' },
  { value: 'Cancelled', label: 'Cancelled' }
];

const asset_height_width_options = [
  { value: 'sq.ft.', label: 'sq.ft.' },
  { value: 'sq.yards', label: 'sq.yards' },
  { value: 'sq.m.', label: 'sq.m.' },
  { value: 'grounds', label: 'grounds' },
  { value: 'aankadam', label: 'aankadam' },
  { value: 'rood', label: 'rood' },
  { value: 'chataks', label: 'chataks' },
  { value: 'perch', label: 'perch' },
  { value: 'guntha', label: 'guntha' },
  { value: 'ares', label: 'ares' },
  { value: 'biswa', label: 'biswa' },
  { value: 'acres', label: 'acres' },
  { value: 'bigha', label: 'bigha' },
  { value: 'kottah', label: 'kottah' },
  { value: 'hectares', label: 'hectares' },
  { value: 'marla', label: 'marla' },
  { value: 'kanal', label: 'kanal' },
  { value: 'cents', label: 'cents' }
]

function defaultReducers(state = initialState, action) {
    switch (action.type) {
      case 'INCREMENTS': {
        return { ...state, value: state.value + 1 }
      }
      case 'counter/decremented':
        return { ...state, value: state.value + 1 }
      case 'counter/both': {
        return { ...state, value: state.value - 1, more: 'Test', pay: action.payload }
      }
      case 'counter/one': {
        return { ...state, obj: state.pay.map(val =>{console.log(val);return{...val, val: val}}) }
      }
      case 'loader': {
        return { ...state, loader:action.payload }
      }
      default:
        return state
    }
};
export default defaultReducers;
